enum ActionKind {
    Walking,
    Idle,
    Jumping,
    LWalking,
    RWalk,
    RightJump,
    LeftJump,
    IdleJump,
    RightIdle,
    LeftIdle
}
namespace SpriteKind {
    export const collectibles = SpriteKind.create()
    export const HUD = SpriteKind.create()
}
function MoveitMovit(targetSprite: Sprite, dir: number) {
    currentenemVEL = currentenemVEL * dir
    targetSprite.setVelocity(currentenemVEL, 0)
}
function enemySpawn(enem: Sprite) {
    Grandmother = enem
    scene.placeOnRandomTile(enem, 5)
}
